import React, { useState } from "react";

/**
 * StudentLookup — polished UI variant
 * Uses POST /api/students/verify-and-get
 */

export default function StudentLookup() {
  const [registerNumber, setRegisterNumber] = useState("");
  const [dob, setDob] = useState("");
  const [loading, setLoading] = useState(false);
  const [marks, setMarks] = useState(null);
  const [error, setError] = useState("");

  async function handleSubmit(e) {
    e.preventDefault();
    setError("");
    setMarks(null);

    if (!registerNumber.trim() || !dob.trim()) {
      setError("Please enter both Register Number and Date of Birth.");
      return;
    }

    setLoading(true);
    try {
      const res = await fetch("/api/students/verify-and-get", {
        method: "POST",
        headers: { "Content-Type": "application/json" },
        body: JSON.stringify({ register_number: registerNumber.trim(), dob: dob.trim() })
      });
      const data = await res.json();
      if (!res.ok) {
        setError(data.error || "Failed to fetch marks. Try again.");
      } else {
        setMarks(data.marks || []);
      }
    } catch (err) {
      console.error(err);
      setError("Network error. Make sure the backend is running.");
    } finally {
      setLoading(false);
    }
  }

  return (
    <div className="center-wrap">
      <div className="card glass fade-in">
        <h1 className="title">Student Lookup</h1>

        <form onSubmit={handleSubmit} className="form-grid">
          <label className="label">
            Register Number
            <input
              className="input"
              value={registerNumber}
              onChange={(e) => setRegisterNumber(e.target.value)}
              placeholder="e.g. 421622205001"
            />
          </label>

          <label className="label">
            Date of Birth (YYYY-MM-DD)
            <input
              className="input"
              value={dob}
              onChange={(e) => setDob(e.target.value)}
              placeholder="2005-03-12"
            />
          </label>

          <div className="actions">
            <button className="btn btn-primary" disabled={loading}>
              {loading ? "Checking..." : "View Marks"}
            </button>
          </div>
        </form>

        {error && <div className="alert error">{error}</div>}

        {marks && (
          <div className="results fade-in-up">
            <h3>Marks for {registerNumber}</h3>
            {marks.length === 0 ? (
              <div className="muted">No marks found for this student.</div>
            ) : (
              <table className="marks-table">
                <thead>
                  <tr>
                    <th>Subject</th>
                    <th>Marks</th>
                    <th>Uploaded By</th>
                    <th>Uploaded At</th>
                  </tr>
                </thead>
                <tbody>
                  {marks.map((m, idx) => (
                    <tr key={idx}>
                      <td>{m.subject_code || m.subject_name || m.subject}</td>
                      <td>{m.marks}</td>
                      <td>{m.uploaded_by || "-"}</td>
                      <td>{m.uploaded_at ? new Date(m.uploaded_at).toLocaleString() : "-"}</td>
                    </tr>
                  ))}
                </tbody>
              </table>
            )}
          </div>
        )}
      </div>
    </div>
  );
}
